        RAISE EXCEPTION 'No se encontró la tabla en ceragen.audi_tables: %', TG_TABLE_NAME;
    END IF;

    -- Determinar el tipo de operación (INSERT o UPDATE)
    sql_command_type := TG_OP;

    -- Insertar el registro en la tabla de auditoría
        ser_table_id,
