--
-- Name: sp_get_dashboard_admin(); Type: FUNCTION; Schema: ceragen; Owner: postgres
--

CREATE FUNCTION ceragen.sp_get_dashboard_admin() RETURNS TABLE(total_empleados integer, total_clientes integer, total_facturas integer, total_nomina double precision, total_promociones integer, total_earnings double precision, total_expenses double precision, earnings_mes double precision, expenses_mes double precision, total_2024 double precision, total_2025 double precision, growth_percentage numeric, product_mas_vendido character varying)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_total_2024 DOUBLE PRECISION;
    v_total_2025 DOUBLE PRECISION;
    v_growth NUMERIC;
    v_product_name VARCHAR;
BEGIN
    -- Total ingresos 2024
    SELECT COALESCE(SUM(inv.inv_grand_total), 0)::DOUBLE PRECISION
    INTO v_total_2024
    FROM ceragen.admin_invoice AS inv
    WHERE inv.inv_state = TRUE
      AND inv.date_deleted IS NULL
      AND DATE_PART('year', inv.inv_date) = 2024;

    -- Total ingresos 2025
    SELECT COALESCE(SUM(inv.inv_grand_total), 0)::DOUBLE PRECISION
    INTO v_total_2025
    FROM ceragen.admin_invoice AS inv
    WHERE inv.inv_state = TRUE
      AND inv.date_deleted IS NULL
      AND DATE_PART('year', inv.inv_date) = 2025;

    -- Porcentaje de crecimiento
    IF v_total_2024 = 0 THEN
        v_growth := 0;
    ELSE
        v_growth := ROUND(((v_total_2025 - v_total_2024) / v_total_2024) * 100::NUMERIC, 2);
    END IF;

    -- Producto más vendido (por número de apariciones en invoice_detail)
    SELECT pro.pro_name
    INTO v_product_name
    FROM ceragen.admin_product pro
    WHERE pro.pro_state = TRUE
    ORDER BY (
                 SELECT COUNT(*)
                 FROM ceragen.admin_invoice_detail det
                 WHERE det.ind_product_id = pro.pro_id
             ) DESC
    LIMIT 1;

    RETURN QUERY
        SELECT
            (SELECT COUNT(*)::INTEGER FROM ceragen.admin_medical_staff WHERE med_state = TRUE),
            (SELECT COUNT(*)::INTEGER FROM ceragen.admin_client WHERE cli_state = TRUE),
            (SELECT COUNT(*)::INTEGER FROM ceragen.admin_invoice WHERE inv_state = TRUE),
            (SELECT COALESCE(SUM(inp.inp_amount), 0)::DOUBLE PRECISION
             FROM ceragen.admin_invoice_payment inp
             WHERE inp.date_deleted IS NULL),
            (SELECT COUNT(*)::INTEGER FROM ceragen.admin_product_promotion WHERE ppr_state = TRUE),
            (SELECT COALESCE(SUM(inv.inv_grand_total), 0)::DOUBLE PRECISION
             FROM ceragen.admin_invoice inv
             WHERE inv.inv_state = TRUE AND inv.date_deleted IS NULL),
            (SELECT COALESCE(SUM(exp.exp_amount), 0)::DOUBLE PRECISION
             FROM ceragen.admin_expense exp
             WHERE exp.exp_state = TRUE AND exp.date_deleted IS NULL),
            (SELECT COALESCE(SUM(inv.inv_grand_total), 0)::DOUBLE PRECISION
             FROM ceragen.admin_invoice inv
             WHERE inv.inv_state = TRUE
               AND inv.date_deleted IS NULL
               AND DATE_PART('month', inv.inv_date) = DATE_PART('month', CURRENT_DATE)
               AND DATE_PART('year', inv.inv_date) = DATE_PART('year', CURRENT_DATE)),
            (SELECT COALESCE(SUM(exp.exp_amount), 0)::DOUBLE PRECISION
             FROM ceragen.admin_expense exp
             WHERE exp.exp_state = TRUE
               AND exp.date_deleted IS NULL
               AND DATE_PART('month', exp.exp_date) = DATE_PART('month', CURRENT_DATE)
               AND DATE_PART('year', exp.exp_date) = DATE_PART('year', CURRENT_DATE)),
            v_total_2024,
            v_total_2025,
            v_growth,
            v_product_name;
END;
$$;


ALTER FUNCTION ceragen.sp_get_dashboard_admin() OWNER TO postgres;

